    box-shadow: 3px 3px 3px rgba(0, 0, 0, .3);
`

function Header() {
    return (
        <StyledHeader>
            <a href="" className="logo">Stack overflow</a>
            <form action="" className="search">
                <input type="text" placeholder="Search..."></input>
            </form>
            <a href="" className="profile">kimkisic</a>
        </StyledHeader>
    )
}

export default Header;
